import { type } from "os";
import { CodeDisplay, MULTI_RESOURCE } from "../config";
import { ResourceMaster } from "../Interfaces";
import ResourceMain from "./ResourceMai";

interface Subject extends MULTI_RESOURCE {
  resource:
    | "Group"
    | "Device"
    | "Location"
    | "Patient"
    | "Specimen"
    | "Practitioner"
    | "PractitionerRole";
}

const mediaStatusArray = [
  "preparation",
  "in-progress",
  "not-done",
  "on-hold ",
  "stopped",
  "completed",
  "entered-in-error",
  "unknown",
] as const;
type MediaStatus = typeof mediaStatusArray[number];
const mediaMimeType = [
  "image/jpeg",
  "image/png",
  "image/bmp",
  "audio/mpeg",
  "video/mp4",
  "video/mpeg",
] as const;
type MediaMimeType = typeof mediaMimeType[number];

export interface MEDIA {
  id?: string;
  status: MediaStatus;
  subject: Subject;
  createdDate: string;
  bodySite: CodeDisplay[];
  /**
   * device used to get  image like Ct scan camery etc
   */
  modality: CodeDisplay[];
  mimeType: MediaMimeType;
  title: string;
  base64Data: string;
}

export class Media extends ResourceMain implements ResourceMaster {
 async toHtml():Promise<string> {
    throw new Error("Method not implemented.");
  }
  getFHIR(options: MEDIA) {
    const body = {
      resourceType: "Media",
      id: options.id || undefined,
      meta: {
        profile: ["https://nrces.in/ndhm/fhir/r4/StructureDefinition/Media"],
      },
      text: {
        status: "generated",
        div: `<div xmlns="http://www.w3.org/1999/xhtml">${options.title}</div>`,
      },
      status: options.status,
      modality: {
        coding: options.modality,
      },
      subject: {
        reference: `${options.subject.resource}/${options.subject.id}`,
      },
      createdDateTime: options.createdDate,
      bodySite: {
        coding: options.bodySite,
      },
      content: {
        contentType: options.mimeType,
        language: "en-IN",
        data: options.base64Data,
        title: options.title,
        creation: options.createdDate,
      },
    };

    return body;
  }
  convertFhirToObject(options: any): MEDIA {
    let ret: MEDIA = {
      status: options.status,
      subject: this.getFromMultResource(options.subject) as any,
      createdDate: options.createdDateTime,
      bodySite: options.bodySite.coding,
      modality: options.modality.coding,
      mimeType: options.content.contentType,
      title: options.content.title,
      base64Data: options.content.data,
      id: options.id,
    };

    return ret;
  }
  statusArray(): MediaStatus[] {
    return mediaStatusArray.map((el) => el);
  }

  mimeTypeArray(): MediaMimeType[] {
    return mediaMimeType.map((el) => el);
  }

  bundlify(resource: any): any {
    const copy = super.bundlify(resource);
    const bodySite: {
      coding: {
        display: string;
        system: string;
      }[];
    } = copy.bodySite;

    if(copy.bodySite && copy.bodySite.coding && copy.bodySite.coding.length > 0){
      copy.bodySite.coding = bodySite.coding.map(el=>{
        if(el.system == ""){
          el.system = "https://www.nicehms.com/bodysite"
        }
        return el
      })
    }


    const content: {
      "contentType": string,
      "creation": string,
      "data": string,
      "language":string
      "title": string
    }= copy.content;
    if(content.data == ""){
      content.data =noImage
      copy.content= content;
    }

    const modality: {
      "coding": [
        {
          "display": string,
          "system": string
        }
      ]
    }=copy.modality

    if(copy.modality && copy.modality.coding && copy.modality.coding.length){
      copy.modality.coding = modality.coding.map(el=>{
        if(el.system == ""){
          el.system = "https://www.nicehms.com/modality"
        }
        return el
      })
    }

    return copy
  }
}


